import React, { Component } from 'react';
import axios from 'axios'

class Api extends Component {
    state = { 
        userData:[]
     }

    componentDidMount() {
        axios.get('https://jsonplaceholder.typicode.com/posts')
        .then(response => {
            // console.log(response)
            this.setState({
                userData: response.data[1]
            })
            console.log(this.state.userData)

        })
        .catch(error => {
            console.log(error)
        })
    }

    render() { 
        let value = this.state.userData
        return ( 
            <div>
                <p>Office Address: {value.title}</p>
        <p>{value.value}</p>
        <p>{value.subType}</p>
            </div>
         );
    }
}

export default Api;
